  },
  {
    name: "Tiger Lilly",
    chefName: "Yanir Green",
    pic: "../../assets/restaurants/tiger-lilly/tiger-lilly.png",
  },
  {
    name: "Ya Pan",
    chefName: "Yuval Ben Neriah",
    pic: "../../assets/restaurants/ya-pan/ya-pan.png",
  },
  {
    name: "Nithan Thai",
    chefName: "Yanir Green",
    pic: "../../assets/restaurants/nithan-thai/nithan-thai.png",
  },
  {
    name: "Claro",
    chefName: "Ran Shmueli",
    pic: "../../assets/restaurants/claro/claro.png",
  },
  {
    name: "Kab Kem",
    chefName: "Yariv Malili",
    pic: "../../assets/restaurants/kab-kem/kab-kem.png",
  },
  {
    name: "Messa",
    chefName: "Aviv Moshe",
    pic: "../../assets/restaurants/messa/messa.png",
  },
  {
    name: "Tiger Lilly",
    chefName: "Yanir Green",
    pic: "../../assets/restaurants/tiger-lilly/tiger-lilly.png",
  },
];

const Restaurants = () => {
  return (
    <div className="rest-container">
      <div className="rest-title">RESTAURANTS</div>
      <div className="rest-buttons">
        <div className="rest-button">All</div>
        <div className="rest-button">New</div>
        <div className="rest-button">Most Popular</div>
        <div className="rest-button">Open Now</div>
      </div>
      <div className="rests">
        {RESTAURANTS.map((rest) => {
          return (
            <PicContainer
              type="rest"
              pic={rest.pic}
              title={rest.name}
              text={rest.chefName}
              icon=""
              price=""
            />
          );
        })}
      </div>
    </div>
  );
};

export default Restaurants;
